import React from "react";
import "./App.css";
import "bulma/css/bulma.css";
import { Title } from "./components/Title";

function App() {
  return (
    <div className="App">
      <p>Buscador de peliculas</p>
      <Title>Buscador de peliculas</Title>
    </div>
  );
}

export default App;
